import React from 'react'

export const Pagination = ({offset, onClickBack, onClickNext}) => {
  return (
    <div>
        {offset === 20 ? null :<button onClick={onClickBack}>Back</button>}

        <p>{offset}</p>

        {offset === 140 ? null :<button onClick={onClickNext}>Next</button> }
    </div>
  )
}
